import React from "react";

interface ImportButtonProps {
  handleOnClick(): void;
}

export default function ImportButton({ handleOnClick }: ImportButtonProps) {
  return (
    <input
      type="file"
      className="w-24 h-7 border-t-2 border-l-2 bg-green-200 border-solid border-zinc-700 text-center justify-center"
      onClick={handleOnClick}
    >
      Import
    </input>
  );
}
